import {Swiper, SwiperSlide} from "swiper/react";
import "swiper/swiper.min.css";
import "swiper/components/effect-coverflow/effect-coverflow.min.css";
import "swiper/components/pagination/pagination.min.css";
import "swiper/components/navigation/navigation.min.css";
import "./styles.css";
import SwiperCore, {EffectCoverflow, Pagination, Navigation} from "swiper/core";

SwiperCore.use([EffectCoverflow, Pagination, Navigation]);

export default function App() {
  return (
    <div className="container">
      <div className="title_wrapper"></div>
      <Swiper
        centeredSlides={false}
        slidesPerView={3}
        spaceBetween={0}
        coverflowEffect={{
          rotate: 50,
          stretch: 0,
          depth: 100,
          modifier: 1,
          slideShadows: true,
        }}
        pagination={{
          clickable: true,
        }}
        className="mySwiper"
      >
        <SwiperSlide>
          <div className="card">
            <img src="images/heroes.png" alt="" />
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="card">
            <img src="images/heroes.png" />
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="card">
            <img src="images/heroes.png" />
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="card">
            <img src="images/heroes.png" />
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="card">
            <img src="images/heroes.png" />
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="card">
            <img src="images/heroes.png" />
          </div>
        </SwiperSlide>
      </Swiper>
    </div>
  );
}
